import { ProTable } from '@ant-design/pro-components';
import type { ProColumns } from '@ant-design/pro-components';
import { Tag, Button, Space, Modal, Form, Input, Select, message, Switch } from 'antd';
import { PlusOutlined, EditOutlined, DeleteOutlined } from '@ant-design/icons';
import { useState } from 'react';

interface CategoryType {
  id: string;
  name: string;
  slug: string;
  description: string;
  parent: string | null;
  productsCount: number;
  active: boolean;
  createdAt: string;
}

const AdminCategories = () => {
  const [modalVisible, setModalVisible] = useState(false);
  const [form] = Form.useForm();

  const columns: ProColumns<CategoryType>[] = [
    {
      title: 'Name',
      dataIndex: 'name',
      key: 'name',
      width: 200,
    },
    {
      title: 'Slug',
      dataIndex: 'slug',
      key: 'slug',
      width: 180,
      copyable: true,
    },
    {
      title: 'Parent Category',
      dataIndex: 'parent',
      key: 'parent',
      width: 150,
      render: (parent) => parent || <Tag>Root</Tag>,
    },
    {
      title: 'Products',
      dataIndex: 'productsCount',
      key: 'productsCount',
      width: 100,
      align: 'center',
    },
    {
      title: 'Status',
      dataIndex: 'active',
      key: 'active',
      width: 100,
      render: (active) => <Switch checked={active} />,
    },
    {
      title: 'Actions',
      key: 'actions',
      width: 150,
      render: (_, record) => (
        <Space>
          <Button type="link" icon={<EditOutlined />} onClick={() => handleEdit(record)}>
            Edit
          </Button>
          <Button type="link" danger icon={<DeleteOutlined />} onClick={() => handleDelete(record.id)}>
            Delete
          </Button>
        </Space>
      ),
    },
  ];

  const mockData: CategoryType[] = [
    {
      id: '1',
      name: 'Electronics',
      slug: 'electronics',
      description: 'Electronic devices and accessories',
      parent: null,
      productsCount: 156,
      active: true,
      createdAt: '2024-01-15',
    },
    {
      id: '2',
      name: 'Mobile Phones',
      slug: 'mobile-phones',
      description: 'Smartphones and feature phones',
      parent: 'Electronics',
      productsCount: 89,
      active: true,
      createdAt: '2024-01-20',
    },
  ];

  const handleEdit = (record: CategoryType) => {
    form.setFieldsValue(record);
    setModalVisible(true);
  };

  const handleDelete = (id: string) => {
    Modal.confirm({
      title: 'Delete Category',
      content: 'Are you sure you want to delete this category?',
      onOk: () => {
        message.success('Category deleted successfully');
      },
    });
  };

  const handleSubmit = async (values: any) => {
    try {
      message.success('Category saved successfully');
      setModalVisible(false);
      form.resetFields();
    } catch (error) {
      message.error('Failed to save category');
    }
  };

  return (
    <div>
      <ProTable<CategoryType>
        columns={columns}
        dataSource={mockData}
        rowKey="id"
        search={false}
        headerTitle="Categories Management"
        toolBarRender={() => [
          <Button key="add" type="primary" icon={<PlusOutlined />} onClick={() => setModalVisible(true)}>
            Add Category
          </Button>,
