          )}
        </Space>
      ),
    },
  ];

  const mockData: VendorType[] = [
    {
      id: '1',
      businessName: 'Tech Solutions Ltd',
      contactPerson: 'John Smith',
      email: 'john@techsolutions.com',
      phone: '+1234567890',
      status: 'pending',
      subscription: 'Premium',
      productsCount: 45,
      ordersCount: 120,
      revenue: 45678.90,
      joinedAt: '2024-11-01',
    },
    {
      id: '2',
      businessName: 'Fashion Hub Inc',
      contactPerson: 'Jane Doe',
      email: 'jane@fashionhub.com',
      phone: '+1234567891',
      status: 'verified',
      subscription: 'Basic',
      productsCount: 89,
      ordersCount: 340,
      revenue: 89456.50,
      joinedAt: '2024-10-15',
    },
