        dataSource={mockData}
        rowKey="id"
        pagination={{
          defaultPageSize: 20,
          showSizeChanger: true,
        }}
        search={{
          labelWidth: 'auto',
        }}
        headerTitle="Vendor Management"
        scroll={{ x: 1400 }}
      />

      <Modal
        title="Vendor Details"
