  price: number;
  stock: number;
  moq: number;
  status: 'active' | 'inactive' | 'pending';
  images: string[];
  attributes: ProductAttribute[];
  created: string;
}

const mockProducts: Product[] = [
  {
    id: 1,
    name: 'Premium Wireless Headphones',
    sku: 'WH-001',
    category: 'Electronics',
    price: 349.99,
    stock: 156,
