    status: 'active',
    images: ['https://via.placeholder.com/300'],
    attributes: [
      { color: 'Black', price: 349.99, stock: 100, sku: 'WH-001-BLK' },
      { color: 'Silver', price: 349.99, stock: 56, sku: 'WH-001-SLV' },
