import React, { useState } from 'react';
import {
  Card,
  Table,
  Tag,
  Button,
  Space,
  Input,
  Select,
  Drawer,
  Descriptions,
  Steps,
  Timeline,
  message,
  Modal,
  Form,
  Row,
  Col,
  Typography,
  Alert,
} from 'antd';
import {
  SearchOutlined,
  EyeOutlined,
  CheckCircleOutlined,
  CloseCircleOutlined,
  PrinterOutlined,
  TruckOutlined,
} from '@ant-design/icons';
import type { ColumnsType } from 'antd/es/table';

const { Title, Text } = Typography;
const { Option } = Select;

interface Order {
  id: number;
  orderNumber: string;
  customer: string;
  date: string;
  items: number;
  total: number;
  status: string;
  payment: string;
  shippingAddress: string;
}

const mockOrders: Order[] = [
  {
    id: 1,
    orderNumber: 'ORD-2024-10001',
    customer: 'John Doe',
    date: '2024-11-01',
    items: 2,
    total: 399.98,
    status: 'new',
    payment: 'Paid',
    shippingAddress: '123 Main St, NY',
  },
  {
    id: 2,
    orderNumber: 'ORD-2024-10002',
    customer: 'Sarah Smith',
    date: '2024-10-30',
    items: 1,
    total: 199.99,
    status: 'confirmed',
    payment: 'Paid',
    shippingAddress: '456 Oak Ave, CA',
  },
  {
    id: 3,
    orderNumber: 'ORD-2024-10003',
    customer: 'Mike Johnson',
    date: '2024-10-28',
    items: 3,
    total: 549.97,
    status: 'shipped',
    payment: 'Paid',
    shippingAddress: '789 Pine Rd, TX',
  },
];

const VendorOrdersPage: React.FC = () => {
  const [orders, setOrders] = useState<Order[]>(mockOrders);
  const [selectedOrder, setSelectedOrder] = useState<Order | null>(null);
  const [drawerVisible, setDrawerVisible] = useState(false);
  const [trackingModalVisible, setTrackingModalVisible] = useState(false);
  const [form] = Form.useForm();

  const getStatusColor = (status: string) => {
    const colors: Record<string, string> = {
      new: 'blue',
      confirmed: 'cyan',
      processing: 'orange',
      shipped: 'purple',
      delivered: 'success',
      cancelled: 'error',
    };
    return colors[status] || 'default';
  };

  const handleViewOrder = (order: Order) => {
    setSelectedOrder(order);
    setDrawerVisible(true);
  };

  const handleConfirmOrder = (order: Order) => {
    Modal.confirm({
      title: 'Confirm Order',
      content: `Confirm order ${order.orderNumber}?`,
      onOk: () => {
        setOrders(
          orders.map((o) =>
            o.id === order.id ? { ...o, status: 'confirmed' } : o
          )
        );
        message.success('Order confirmed successfully');
      },
    });
  };

  const handleShipOrder = (order: Order) => {
    setSelectedOrder(order);
    setTrackingModalVisible(true);
  };

  const handleCancelOrder = (order: Order) => {
    Modal.confirm({
      title: 'Cancel Order',
      content: `Are you sure you want to cancel order ${order.orderNumber}?`,
      okText: 'Yes, Cancel Order',
      okType: 'danger',
      onOk: () => {
        setOrders(
          orders.map((o) =>
            o.id === order.id ? { ...o, status: 'cancelled' } : o
          )
        );
        message.success('Order cancelled');
      },
    });
  };

  const handleSubmitTracking = (values: any) => {
    console.log('Tracking info:', values);
    if (selectedOrder) {
      setOrders(
        orders.map((o) =>
          o.id === selectedOrder.id ? { ...o, status: 'shipped' } : o
        )
      );
      message.success('Order marked as shipped with tracking info');
      setTrackingModalVisible(false);
      form.resetFields();
    }
  };

  const columns: ColumnsType<Order> = [
    {
      title: 'Order Number',
      dataIndex: 'orderNumber',
      key: 'orderNumber',
      render: (text: string) => <Text strong>{text}</Text>,
    },
    {
      title: 'Customer',
      dataIndex: 'customer',
      key: 'customer',
    },
    {
      title: 'Date',
      dataIndex: 'date',
      key: 'date',
      render: (date: string) => new Date(date).toLocaleDateString(),
      sorter: (a, b) => new Date(a.date).getTime() - new Date(b.date).getTime(),
    },
    {
      title: 'Items',
      dataIndex: 'items',
      key: 'items',
    },
    {
      title: 'Total',
      dataIndex: 'total',
      key: 'total',
      render: (total: number) => (
        <Text strong style={{ color: '#52c41a' }}>
          ${total.toFixed(2)}
        </Text>
      ),
      sorter: (a, b) => a.total - b.total,
    },
    {
      title: 'Payment',
      dataIndex: 'payment',
      key: 'payment',
      render: (payment: string) => (
        <Tag color="success">{payment}</Tag>
      ),
    },
    {
      title: 'Status',
      dataIndex: 'status',
      key: 'status',
      render: (status: string) => (
        <Tag color={getStatusColor(status)}>{status.toUpperCase()}</Tag>
      ),
      filters: [
        { text: 'New', value: 'new' },
        { text: 'Confirmed', value: 'confirmed' },
        { text: 'Processing', value: 'processing' },
        { text: 'Shipped', value: 'shipped' },
        { text: 'Delivered', value: 'delivered' },
        { text: 'Cancelled', value: 'cancelled' },
      ],
      onFilter: (value, record) => record.status === value,
    },
    {
      title: 'Actions',
      key: 'actions',
      render: (_, record) => (
        <Space>
          <Button
            type="link"
            icon={<EyeOutlined />}
            onClick={() => handleViewOrder(record)}
          >
            View
          </Button>
          {record.status === 'new' && (
            <Button
              type="link"
              icon={<CheckCircleOutlined />}
              onClick={() => handleConfirmOrder(record)}
            >
              Confirm
            </Button>
          )}
          {(record.status === 'confirmed' || record.status === 'processing') && (
            <Button
              type="link"
              icon={<TruckOutlined />}
              onClick={() => handleShipOrder(record)}
            >
              Ship
            </Button>
          )}
          {(record.status === 'new' || record.status === 'confirmed') && (
            <Button
              type="link"
              danger
              icon={<CloseCircleOutlined />}
              onClick={() => handleCancelOrder(record)}
            >
              Cancel
            </Button>
          )}
        </Space>
      ),
    },
  ];

  return (
    <div style={{ padding: 24 }}>
      <Card title={<Title level={3}>Order Management</Title>}>
        {/* Filters */}
        <Row gutter={16} style={{ marginBottom: 16 }}>
          <Col xs={24} sm={12} md={8}>
            <Input
              placeholder="Search orders..."
              prefix={<SearchOutlined />}
              size="large"
            />
          </Col>
          <Col xs={24} sm={12} md={6}>
            <Select placeholder="Status" size="large" style={{ width: '100%' }}>
              <Option value="all">All Orders</Option>
              <Option value="new">New</Option>
              <Option value="confirmed">Confirmed</Option>
              <Option value="processing">Processing</Option>
              <Option value="shipped">Shipped</Option>
              <Option value="delivered">Delivered</Option>
              <Option value="cancelled">Cancelled</Option>
            </Select>
          </Col>
        </Row>

        {/* Stats */}
        <Row gutter={16} style={{ marginBottom: 16 }}>
          <Col span={6}>
            <Card size="small">
              <Text type="secondary">Total Orders</Text>
              <Title level={3} style={{ margin: 0 }}>
                {orders.length}
              </Title>
            </Card>
          </Col>
          <Col span={6}>
            <Card size="small">
              <Text type="secondary">New Orders</Text>
              <Title level={3} style={{ margin: 0, color: '#1890ff' }}>
                {orders.filter((o) => o.status === 'new').length}
              </Title>
            </Card>
          </Col>
          <Col span={6}>
            <Card size="small">
              <Text type="secondary">In Progress</Text>
              <Title level={3} style={{ margin: 0, color: '#faad14' }}>
                {orders.filter((o) => ['confirmed', 'processing', 'shipped'].includes(o.status)).length}
              </Title>
            </Card>
          </Col>
          <Col span={6}>
            <Card size="small">
              <Text type="secondary">Total Revenue</Text>
              <Title level={3} style={{ margin: 0, color: '#52c41a' }}>
                ${orders.reduce((sum, o) => sum + o.total, 0).toFixed(2)}
              </Title>
            </Card>
          </Col>
        </Row>

        {/* Orders Table */}
        <Table
          columns={columns}
          dataSource={orders}
          rowKey="id"
          pagination={{
            pageSize: 10,
