  {
    id: 5,
    name: 'David Wilson',
    email: 'david.w@example.com',
    phone: '+1 234-567-8904',
    location: 'Miami, USA',
    totalOrders: 12,
    totalSpent: 1899.88,
    status: 'active',
    joinDate: '2024-02-28',
  },
];

const VendorCustomersPage: React.FC = () => {
