  Modal,
  Form,
} from 'antd';
import {
  SearchOutlined,
  EyeOutlined,
  DownloadOutlined,
  RedoOutlined,
  MessageOutlined,
  StarOutlined,
} from '@ant-design/icons';
import type { ColumnsType } from 'antd/es/table';
import { history } from 'umi';

const { Title, Text, Paragraph } = Typography;
const { RangePicker } = DatePicker;
const { Option } = Select;
const { TextArea } = Input;

interface OrderItem {
  id: number;
  productName: string;
  quantity: number;
  price: number;
  image: string;
}

interface Order {
  id: number;
  orderNumber: string;
  date: string;
  status: string;
  total: number;
  items: OrderItem[];
  shippingAddress: string;
  paymentMethod: string;
  trackingNumber?: string;
  vendor: string;
}

const mockOrders: Order[] = [
  {
    id: 1,
    orderNumber: 'ORD-2024-10001',
    date: '2024-10-15',
    status: 'delivered',
    total: 349.99,
    vendor: 'TechHub Store',
    paymentMethod: 'Credit Card ****4242',
    trackingNumber: 'TRK1234567890',
    shippingAddress: '123 Main St, New York, NY 10001',
    items: [
      {
        id: 1,
        productName: 'Premium Wireless Headphones',
        quantity: 1,
        price: 349.99,
        image: 'https://via.placeholder.com/80/1890ff/fff?text=Product',
      },
    ],
  },
  {
    id: 2,
    orderNumber: 'ORD-2024-10002',
    date: '2024-10-20',
    status: 'in_process',
    total: 249.98,
    vendor: 'Gadget World',
    paymentMethod: 'PayPal',
    trackingNumber: 'TRK0987654321',
    shippingAddress: '123 Main St, New York, NY 10001',
    items: [
      {
        id: 2,
        productName: 'Smart Watch Pro',
        quantity: 1,
        price: 199.99,
        image: 'https://via.placeholder.com/80/52c41a/fff?text=Product',
      },
      {
        id: 3,
        productName: 'Laptop Backpack',
        quantity: 1,
        price: 49.99,
        image: 'https://via.placeholder.com/80/faad14/fff?text=Product',
      },
    ],
  },
  {
    id: 3,
    orderNumber: 'ORD-2024-10003',
    date: '2024-10-25',
    status: 'confirmed',
    total: 89.99,
    vendor: 'Gaming Hub',
    paymentMethod: 'Cash on Delivery',
    shippingAddress: '456 Office Blvd, New York, NY 10002',
    items: [
      {
        id: 4,
        productName: 'Mechanical Gaming Keyboard',
        quantity: 1,
